import React from "react";
import "../styles/App.css";

const templates = [
  {
    name: "Markdown Journal Template",
    description: "A minimal Obsidian-style journal with metadata headers.",
    fileType: "Markdown",
    downloads: 42,
  },
  {
    name: "Go CLI App Starter",
    description: "Basic CLI app using Cobra and Lipgloss for styling.",
    fileType: "Go",
    downloads: 30,
  },
];

export default function Templates() {
  return (
    <div className="page-container">
      <h2 className="page-title">Templates</h2>
      <div className="repo-list">
        {templates.map((tpl, i) => (
          <div key={i} className="repo-card">
            <div className="repo-header">
              <span className="repo-name">{tpl.name}</span>
              <span className="repo-stars">â¬‡ {tpl.downloads}</span>
            </div>
            <p className="repo-description">{tpl.description}</p>
            <div className="repo-meta">
              <span className="repo-lang">{tpl.fileType}</span>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
